import styled from "styled-components";

export const P = styled.p`
display: grid;
flex-direction: row;
justify-content: center;
min-height: 15vh;
min-height: 25vh;
min-width: 15vw;
max-width: 20vw;
right: 30%;
bottom: -75px;
position: relative;
`;

export const H = styled.h1`
position: relative;
height: 100px;
font-size: 30px;
font-weight: 700;
background: grey;
display: flex;
align-items: center;
justify-content: left;
color: white;
`;
